import React from 'react';

const Input = props => {
  return (
    <div>
      <input
        className='col s12 m12 l12'
        type='number'
        id={props.name}
        value={props.item.req}
        onChange={props.change}
        autoFocus
      />
    </div>
  );
};

export default Input;
